import Vuex from "vuex";
import Vue from "vue";

Vue.use(Vuex);

const store = new Vuex.Store({
  state:{
    logged:localStorage.getItem("token")!=null
  },
  mutations:{
    setLoggedTrue: (state)=>{
      state.logged = true;
    },
    setLoggedFalse: (state)=>{
      state.logged = false;
    }
  },
})

export default store;
